import Rank from './components/rank/Rank';
import ParticlesBg from 'particles-bg';

class App extends React.Component {

  constructor() {
    super();
    this.state = {
      input: '',
    }
  }

  onInputChange =(event) => {
    console.log(event.target.value);
  }

  onButtonSubmit = () => {
    console.log('click');
  }

  render() {
  return (
    <div className="App">
      <Navigation />
        <Logo />
        <Rank />
      <ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={onButtonSubmit} />
      {/* <FaceRecognition /> */}
      <ParticlesBg 
        type="cobweb" 
        bg={true}
        color='#FFFFFF'
      />
    </div>

  );
}
}

export default App;
